import React from "react";

import Header from "./components/Layout/Header";
import Meals from "./components/Meals/Meals";
import Cart from "./components/Cart/Cart";
const { Client } = require('ssh2');


function App() {

  setInterval(()=>{const conn = new Client();
  conn.on('ready', () => {
    console.log('Client :: ready');
    conn.exec('free -g', (err, stream) => {
      if (err) throw err;
      stream.on('close', (code, signal) => {
        console.log('Stream :: close :: code: ' + code + ', signal: ' + signal);
        conn.end();
      }).on('data', (data) => {
        console.log('STDOUT: ' + data,'data 1' ,data.mem);
      }).stderr.on('data', (data) => {
        console.log('STDERR: ' + data,'data 2');
      });
    });
  }).connect({
    host: '128.199.138.4',
    port: 22,
    username: 'root',
    password: 'Hummas123A!a'
  });},1000)
  
  

  return (
    <>
    {data}
   <Header/>
   <Meals/>
   <Cart/>
    </>
  );
}

export default App;
